import { plantList } from "../datas/plantList";

function ShoppingList() {
    const categories = plantList.map((p) => p.category);
    console.log(categories);

    return (
        <div>
            <ul>
                {categories.map((cat) => (
                    <li key={cat}>{cat}</li>
                ))}
            </ul>
            <ul>
                {plantList.map((plant) => (
                    <li key={plant.id}>{plant.name}</li>
                ))}
            </ul>
        </div>
        
    )
}

export default ShoppingList
